import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on a category to get to product listing page
    await page.waitForSelector('a[href="#"]');
    await page.click('text=Electronics');
    await page.waitForLoadState('networkidle');

    // Wait for view toggle controls to be available
    await page.waitForSelector('.view-toggle');

    // Click the list view button
    const listViewButton = await page.$('button[title="List View"]');
    if (!listViewButton) {
      throw new Error('List view button not found');
    }

    await listViewButton.click();
    await page.waitForTimeout(1000); // Wait for view transition

    // Verify list view is active
    await page.waitForSelector('button[title="List View"].active');
    await page.waitForSelector('.products-list');

    // Take screenshot after switching to list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_list_view.png'));

    // Extract verification data
    const activeView = await page.$eval('.view-btn.active', el => el.getAttribute('title'));
    const productContainerClass = await page.$eval('div[class*="products-"]', el => el.className);
    const productCards = await page.$$eval('.product-card-list', cards => cards.length);

    return {
      success: true,
      action: "Switched to list view mode",
      extractedData: {
        activeView,
        productContainerClass,
        productCardsCount: productCards
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
